script: |
  super -f text -I q6451.spq | sort > q6451.out

inputs:
  - name: q6451.spq
    data: |
      SELECT col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 ) NOT BETWEEN - col0 * col0 * col0 AND ( + col2 * + col1 );
  - name: tab2

outputs:
  - name: q6451.out
    data: |
      46
      64
      75
